        for i = 2:N-1
            c += 1; is[c] = l*N+i; js[c] = (l+1)*N+i-1; Ls[c] = +E*(l+1)/2(2l+3)*(l/2v[i]-1/Δv)
            c += 1; is[c] = l*N+i; js[c] = (l+1)*N+i; Ls[c] = +E*(l+1)/2(2l+3)*(l/2v[i]+1/Δv)
