        c += 1; is[c] = l*N+1; js[c] = (l-1)*N+1; Ls[c] = -E*l/2(2l-1)*((l+1)/2vb[1])
        c += 1; is[c] = l*N+1; js[c] = (l-1)*N+1+1; Ls[c] = -E*l/2(2l-1)*((l+1)/2vb[1]-1/Δv)
        for i = 2:N-1
            c += 1; is[c] = l*N+i; js[c] = (l-1)*N+i; Ls[c] = -E*l/2(2l-1)*((l+1)/2vb[i]+1/Δv)
            c += 1; is[c] = l*N+i; js[c] = (l-1)*N+i+1; Ls[c] = -E*l/2(2l-1)*((l+1)/2vb[i]-1/Δv)
        end
        c += 1; is[c] = l*N+N; js[c] = (l-1)*N+N; Ls[c] = -E*l/2(2l-1)*((l+1)/2vb[N]+1/Δv)
        for i = 1:N
            c += 1; is[c] = l*N+i; js[c] = l*N+i; Ls[c] = -νₜₒₜvb[i]
        end
    end

    if μ != 0
        for i = 1:(lmax+1)N
            c += 1; is[c] = i; js[c] = i; Ls[c] = -μ
        end
    end

    L = sparse(@view(is[1:c]),@view(js[1:c]),@view(Ls[1:c]),(lmax+1)N,(lmax+1)N)
    dropzeros!(L)

    F = qr(L)

    G = Vector{Float64}(undef,(lmax+1)N)
    randexp!(@view G[1:N])
    randn!(@view G[N+1:end])
    G ./= Δv*sum(G[i] for i = 1:N)

#    return L, F, G

    ω₀ₚₚ = ω₀ₚ = ω₀ = NaN
    ε̄ₚₚ = ε̄ₚ = ε̄ = NaN
    ω₁Fₚₚ = ω₁Fₚ = ω₁F = NaN
    σ²ω₀ₚ = σ²ω₀ = NaN
    σ²ε̄ₚ = σ²ε̄ = NaN
    σ²ω₁Fₚ = σ²ω₁F = NaN
    iterations = 0
    a = Anderson(G,m=3)
    converged = true
    while true
        iterations += 1
        #iterations > 10000 && throw("Convergence failed.")
        if iterations > 10000 
            converged = false 
            break
        end

        ldiv!(F,G)
        G ./= Δv*sum(G[i] for i = 1:N)
        accelerate!(a,G)
        G ./= Δv*sum(G[i] for i = 1:N)

        ω₀ₚₚ, ω₀ₚ, ω₀ = ω₀ₚ, ω₀, Δv*sum(νₙₑₜ[i]*G[i] for i = 1:N)
        ε̄ₚₚ, ε̄ₚ, ε̄ = ε̄ₚ, ε̄, Δv*sum(ε[i]*G[i] for i = 1:N)
