        σ²ε̄ₚ, σ²ε̄ = σ²ε̄, (-2ε̄ₚₚ+ε̄ₚ+ε̄)^2+(ε̄ₚₚ-2ε̄ₚ+ε̄)^2+(ε̄ₚₚ+ε̄ₚ-2ε̄)^2
        σ²ω₁Fₚ, σ²ω₁F = σ²ω₁F, (-2ω₁Fₚₚ+ω₁Fₚ+ω₁F)^2+(ω₁Fₚₚ-2ω₁Fₚ+ω₁F)^2+(ω₁Fₚₚ+ω₁Fₚ-2ω₁F)^2
        if (σ²ω₀ >= σ²ω₀ₚ && σ²ε̄ >= σ²ε̄ && σ²ω₁F >= σ²ω₁Fₚ) || (iterations >= 20 && iterations % 2 == 0)
