        end
    end

    verbose && @show iterations
    WF = γ*ω₁F

    verbose && println("Solving HOH equations...")

    Lᴴᴼᴴ = L
    if μ != ω₀
        for i = 1:(lmax+1)N
            Lᴴᴼᴴ[i,i] += μ - ω₀
        end
    end
