    G[N], B = G[N], (G[N] = 0; Fᴴᴼᴴ\G)

    # Building G^(T) system
    c = 0
    for i = 1:N
        c += 1; is[c] = i; js[c] = i; Ls[c] = 1
    end

    # L10
    l = 1
    c += 1; is[c] = l*N+1; js[c] = (l-1)*N+1; Ls[c] = E*(1-l)/2(2l-1)*((l+1)/2vb[1])
    c += 1; is[c] = l*N+1; js[c] = (l-1)*N+1+1; Ls[c] = E*(1-l)/2(2l-1)*((l+1)/2vb[1]-1/Δv)
    for i = 2:N-1
        c += 1; is[c] = l*N+i; js[c] = (l-1)*N+i; Ls[c] = E*(1-l)/2(2l-1)*((l+1)/2vb[i]+1/Δv)
        c += 1; is[c] = l*N+i; js[c] = (l-1)*N+i+1; Ls[c] = E*(1-l)/2(2l-1)*((l+1)/2vb[i]-1/Δv)
    end
    c += 1; is[c] = l*N+N; js[c] = (l-1)*N+N; Ls[c] = E*(1-l)/2(2l-1)*((l+1)/2vb[N]+1/Δv)

