    # G^(T)
    # A[l*N+i] = -v[i]*((G[(l-1)*N+i-1]+G[(l-1)*N+i])/2(2l-1) - (G[(l+1)*N+i-1]+G[(l+1)*N+i])/2(2l+3))
    # A[1:N] .= 0
    A = similar(G)
    @turbo for i = 1:N
