        for i = 1
            A[l*N+i] = ω₂F*G[l*N+i] + ω₁/sqrt(3)*Gᴸ[l*N+i] - v[i]/sqrt(3)*((l+1)/(2l+3)*((Gᴸ[(l+1)*N+i])+(l+2)*(Gᵀ[(l+1)*N+i]))/2)
        end
