        kex = γ*σ₀*Δv*sum(νₑₓ(gas,v[i],T_og,supertype)*G[i] for i = 1:N)
    else
        kex = γ*σ₀*Δv*sum(νₑₓ(gas,v[i])*G[i] for i = 1:N)
    end

