    kat = γ*σ₀*Δv*sum(νₐₜ(gas,v[i])*G[i] for i = 1:N)

    α = -kio/W
    η = -kat/W

    G₀ = @view G[1:N]
    G₁ = @view G[N+1:2N]

    μ = abs(W)*1E21/ETd
    μF = abs(WF)*1E21/ETd
    μBrambring = abs(WBrambring)*1E21/ETd
    μKondo = abs(WKondo)*1E21/ETd
    converged = !(attempts > 100 || !converged)


